import './App.css';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';
import React from 'react';



function ButtonAdd() {
 const [input, setInput] = React.useState("");


 const handleClick = () =>{
    setInput(input!==''? input : "");
  }

  return (
    <>
    <div>
    <input type="text" id="What needs to de done?" placeholder="search" />
      <button onClick={handleClick} type='button'>
        Add
      </button>
    </div>

    <Tabs>
    <TabList>
      <Tab>All</Tab>
    </TabList>
    <TabPanel>
    <h2>{input}</h2>

    </TabPanel>
  </Tabs>
  </>


  )
}

function Separadores({input}) {
  return (
    <Tabs>
      <TabList>
        <Tab>All</Tab>
      </TabList>
      <TabPanel>
      <h2>{input}</h2>

      </TabPanel>
    </Tabs>
  );
}



function App() {
  return (
    <div className="App">
      <h1>TODO LIST</h1>
      <ButtonAdd />
      <Separadores />
    </div>
  );
}

export default App;
